import React from "react";
import { Container } from "react-bootstrap";

const Contact = () => {
  return (
    <>
      <div>
        <Container>
          <figure className="position-relative"></figure>
          <img src="../images/footer.png" alt="footer" className="img-fluid" />
        </Container>
      </div>
    </>
  );
};
export default Contact;
